import React, { useState } from 'react';
import reactDom from 'react-dom';
import { Container } from 'reactstrap';


export const Home = () => {

    function teste (){
        console.log("Clicou!");
        let h1=React.createElement("h1", {className: "danger"}, "Testando esse bitao");
        reactDom.render(h1, document.getElementById("valentine"));
    }

    const [isVisible, setIsVisible]=useState(true);

    function juntarFunctions (){

        teste();

        ()=>setIsVisible(!isVisible);
    }

    return (
        <div>
            <Container>
                <div className="d-flex flex-column justify-content-center align-items-center">
                    <div className="w-100 m-auto mt-3 p-3 border rounded-pill d-flex justify-content-center align-items-center" style={{ background: '#23bceb' }}>
                        <div className="m-auto p-2">
                            <h1>Página inicial</h1>
                        </div>
                    </div>
                    <div className="d-flex justify-content-center">
                        <div className="p-2">
                            <a href="/visualizarcliente" className="btn btn-outline-primary btn-lg">Cliente</a>
                        </div>
                        <div className="p-2">
                            <a href="/visualizarservico" className="btn btn-outline-primary btn-lg">Serviço</a>
                        </div>
                        <div className="p-2">
                            <a href="/visualizarpedido" className="btn btn-outline-primary btn-lg">Pedido</a>
                        </div>
                    </div>
                    <div className="d-flex justify-content-center">
                        <div className="p-2">
                            <span onClick={juntarFunctions} className={isVisible ? "btn btn-outline-primary btn-lg visible"
                            : "btn btn-outline-primary btn-lg invisible"}>Bitao teste</span>
                        </div>
                        <div id="valentine" className="p-2">
                        </div>
                    </div>


                </div>
            </Container>
        </div>
    )
}
